BaseOfferResponse::SpecialOfferTypeEnum BaseOfferResponse::toSpecialOfferTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("ALL")) {
        return SpecialOfferTypeEnum::ALL;
    }
    
    if (value == utility::conversions::to_string_t("RESERVABLE")) {
        return SpecialOfferTypeEnum::RESERVABLE;
    }
    
    if (value == utility::conversions::to_string_t("REGULAR_OFFER")) {
        return SpecialOfferTypeEnum::REGULAR_OFFER;
    }
    
    if (value == utility::conversions::to_string_t("ACT_NOW")) {
        return SpecialOfferTypeEnum::ACT_NOW;
    }
    
    if (value == utility::conversions::to_string_t("GET_THERE_NOW")) {
        return SpecialOfferTypeEnum::GET_THERE_NOW;
    }
    
    if (value == utility::conversions::to_string_t("SQOOT")) {
        return SpecialOfferTypeEnum::SQOOT;
    }
    
    if (value == utility::conversions::to_string_t("TICKETS")) {
        return SpecialOfferTypeEnum::TICKETS;
    }
    
    if (value == utility::conversions::to_string_t("YIPIT")) {
        return SpecialOfferTypeEnum::YIPIT;
    }
    
    throw std::invalid_argument("Invalid value for conversion to SpecialOfferTypeEnum");
}


const utility::string_t BaseOfferResponse::fromSpecialOfferTypeEnum(const SpecialOfferTypeEnum value) const
{
    switch(value)
    {
        
        case SpecialOfferTypeEnum::ALL: return utility::conversions::to_string_t("ALL");
        
        case SpecialOfferTypeEnum::RESERVABLE: return utility::conversions::to_string_t("RESERVABLE");
        
        case SpecialOfferTypeEnum::REGULAR_OFFER: return utility::conversions::to_string_t("REGULAR_OFFER");
        
        case SpecialOfferTypeEnum::ACT_NOW: return utility::conversions::to_string_t("ACT_NOW");
        
        case SpecialOfferTypeEnum::GET_THERE_NOW: return utility::conversions::to_string_t("GET_THERE_NOW");
        
        case SpecialOfferTypeEnum::SQOOT: return utility::conversions::to_string_t("SQOOT");
        
        case SpecialOfferTypeEnum::TICKETS: return utility::conversions::to_string_t("TICKETS");
        
        case SpecialOfferTypeEnum::YIPIT: return utility::conversions::to_string_t("YIPIT");
        
    }
}


